tables.table_schema:
CREATE TABLE quantum_sessions (
    session_id UUID PRIMARY KEY,
    session_name VARCHAR(255),
    start_time TIMESTAMP,
    end_time TIMESTAMP
);

CREATE TABLE quantum_devices (
    device_id SERIAL PRIMARY KEY,
    device_name VARCHAR(255),
    device_type VARCHAR(50),
    location VARCHAR(100)
);

CREATE TABLE quantum_connections (
    connection_id SERIAL PRIMARY KEY,
    session_id UUID REFERENCES quantum_sessions(session_id),
    device_id INT REFERENCES quantum_devices(device_id),
    connection_status VARCHAR(50)
);

CREATE TABLE quantum_session (
  session_id UUID PRIMARY KEY,
  start_time TIMESTAMP NOT NULL,
  end_time TIMESTAMP,
  participants JSONB
);

CREATE TABLE qubit_information (
  qubit_id UUID PRIMARY KEY,
  session_id UUID REFERENCES quantum_session(session_id),
  qubit_status VARCHAR(50)
);

CREATE TABLE quantum_devices (
  device_id UUID PRIMARY KEY,
  device_name VARCHAR(100),
  location VARCHAR(100)
);

CREATE TABLE quantum_errors (
  error_id UUID PRIMARY KEY,
  session_id UUID REFERENCES quantum_session(session_id),
  error_code INT
);

CREATE TABLE quantum_communication_sessions (
 session_id INT PRIMARY KEY,
 start_time TIMESTAMP,
 end_time TIMESTAMP,
 participants TEXT
);

CREATE TABLE quantum_devices (
 device_id INT PRIMARY KEY,
 device_name TEXT,
 device_type TEXT,
 software_version TEXT
);

CREATE TABLE quantum_channels (
 channel_id INT PRIMARY KEY,
 source_device_id INT,
 destination_device_id INT,
 channel_type TEXT
);

CREATE TABLE quantum_message_log (
 log_id INT PRIMARY KEY,
 message TEXT,
 timestamp TIMESTAMP,
 sender_device_id INT
);

CREATE TABLE quantum_errors (
 error_id INT PRIMARY KEY,
 error_description TEXT,
 timestamp TIMESTAMP,
 session_id INT
);
